    Content,
    Picture,
    AStore,
    Gplay,
    Textbox,
    Downloadable,
    button
} from './Form.styles.js';

import welcomePage from '../../images/welcomepage.jpg';
import g1 from '../../images/g1.png';
import g2 from '../../images/g2.png';

const welcome = () => {
    return (
        <Wrapper>
            <Content >    
                <Textbox> 
                    <h1> Snabba och prisv√§rdiga resor! </h1>
                    <h2> Ladda ner appen idag </h2>
                    <Downloadable>
                        <AStore><img src={g2} alt="download Appstore" width="60%" height="60%" /></AStore>
                        <Gplay><img src={g1} alt="download google" width="60%" height="60%" /></Gplay>
                    </Downloadable>
                </Textbox>

            </Content >
            <Picture><img src={welcomePage} alt="guy on scooter" width="100%" height="100%" /></Picture>
        </Wrapper>
    )
}

export default welcome;
